import React, {Component} from 'react';

class Form extends Component{

  render(){
    const forms = [
      {
        'url' : PDF0,
        'title' : '14 Month Questionaire',
        'sample' : IMG0
      },
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      },
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      },
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      }
    ];
    const FormPDF = props =>{
      const forms = props.form.map((form,index) =>{
        return(
          <div key={index} className="col-md-3 text-center">
            <a href={form.url} className="col-md-12">
              <img className="col-md-12" src={form.sample} alt="Need Image of Form"/>
              <p className="col-md-12 justify-content-center">{`image at ${form.title}`}</p>
            </a>
          </div>
        )
      });
      return <section id="forms" className="row">
          <h1 className="col-md-12 text-center">Forms</h1>
          {forms}
        </section>
    };
    return <FormPDF id="form" form={forms} />
  }
}
export default Form;
